import React from 'react';

const Contact = () => {
  const images = require.context('../images', true)
  let linkedinImg = images('./linkedin.png')
  let githubImg = images('./github.png')
  let blogImg = images('./blog.png')

  return (
    <div id='contact' className='component'>
      <h1>CONTACT ME</h1>

      <div>
        <h2>Connect on Social</h2>
        <a alt="linkedin_icon" href="https://www.linkedin.com/in/jacquelineklam/" target="_blank">
          <img src={linkedinImg} />
        </a>
        <a alt="github_icon" href="http://github.com/jacqueline-lam" target="_blank">
          <img src={githubImg} />
        </a>
        <a alt="blog_icon" href="http://github.com/jacqueline-lam" target="_blank">
          <img src={githubImg} />
        </a>
      </div>

    </div>
  )
}

export default Contact
